const buttonStyle = {
    justifyContent: "center"
};

function Home() {
    return (
        <form>
            <div className="form-group">
                <div></div>
                <label htmlFor="exampleDate">Дата подачи</label>
                <input type="date" className="form-control" id="exampleDate" placeholder="Дата вывоза"/>
                <label htmlFor="exampleDate">Дата завершения</label>
                <input type="date" className="form-control" id="exampleDate" placeholder="Дата вывоза"/>
            </div>
        </form>
    );
}

export default Home;
